import React from 'react';
import { Alert } from 'react-bootstrap';
import {ReactComponent as MySVG} from "../assets/"
function Card() {
	return (
		<div
			style={{
				backgroundImage: 'url(/assets/card.svg)',
				height: 500,
				backgroundSize: 'cover',
			}}
		>
			<img src="/assets/city.jpeg" />
		</div>
	);
}

export default Card;
